C.AP=new O.cv("Tag My Knowledge",null,"This app is your personal knowledge feed.\n\nWith note taking apps like Google Keep, you're mostly archiving your knowledge. Important pieces of advice get buried and are lost forever as soon as they're pushed below your average scroll threshold. \n\nSo, instead of sorting your notes in chronological order, Tag My Knowledge generates a daily feed. By reading just a few random notes every day, your brain doesn't get the chance to fully forget them. Then, when it actually matters, you'll remember the advice instead of not even knowing where to look. \n\n---\n#### Twitter bot \nQuickly save interesting tweets by replying like this:\n> @TagMyKnowledge save Some Title #yourtag\n\nThe bot will then automatically save this tweet in your collection and match #yourtag to your closest actual tag.\n\nTag My Knowledge available for Android & web (PWA, beta).\n\n*(Note that the Twitter bot can only be set up on Android for now.)*","ux, web design, static website generators, analytics","A big learning was definitely how to make everything more production-ready. \n#### Making code production-ready\n- Unit & integration tests\n- Serverside database migration for old versions of the app\n\n#### Tech stack:\n- **Flutter:** Mobile & web app UI\n- **Firebase:** Auth, Firestore, Functions, Hosting, Remote Config, Analytics\n- **Twitter Api:** For writing the Twitter bot via webhooks\n- **Google Play IAP:** Monetization\n- **Publii:** Static site cms\n- **TailwindCss & Handlebars:** For building the Publii page template\n- **Google Analytics & Google Optimize**: Page & app insights\n",null,null,"https://play.google.com/store/apps/details?id=com.tagmyknowledge","https://tagmyknowledge.com/","tagmyknowledge.png",1596924e6,C.zd,C.yF)
