C.AX=new O.cv("Website Redesign for Switchboard Live",null,"Switchboard Live is a multistreaming service to stream one input to multiple platforms at once. As a freelancer, my job was (among other things) to completely redesign their website to make the most out of the rising covid 19 traffic. I had pretty much full control over everything (layout, graphics, text) except for the video, which already existed. \n\n#### Comparison before & after:\n\n- [snapshot before the relaunch](https://web.archive.org/web/20200314094119/https://switchboard.live/)\n\n- [snapshot right before my contract ended](https://web.archive.org/web/20200909094059/https://switchboard.live/)\n\nThe current website is also linked below, although keep in mind that it might look different by now.","tailwindcss, ejs, webpack, netlify, google tag manager",'- **Netlify:** Deploy directly from the git repository\n- **TailwindCss:** Styling exclusively via utility classes instead of "real" css\n- **Webpack:** Build pipeline, in this case for a static website\n- **Embedded Javascript Templating:** Build .html out of .ejs templates (which can contain js to parse Markdown etc.)\n- **Frontmatter + Markdown:** The "data structure" of the blog posts.\n\nAside from these technical details, I also improved my copywriting skills.',null,null,null,"https://switchboard.live/","switchboard.png",15846588e5,C.yR,C.qD)
