C.AS=new O.cv("Star Clock","star_clock",'This was my entry for the [Flutter Clock Face Contest.](https://flutter.dev/clock)The goal was to create a clock face for upcoming Lenovo Smart clocks.\n\n**Features:**\n- Day/night transition\n- 7 weather conditions complete with animations\n- Night-only mode\n\n**Result:** I got a top 25 placement & won a Lenovo Smart clock :)\n\nClick on "Demo" to watch the 30 sec demo video on YouTube!',"animation, adobe after effects","- **Animations:** These were created using Flare (now called Rive)\n- **Bugfixing:** I ran into some incredibly strange bugs during this project.In the future, I'll check open flutter & rive issues more thoroughly :)\n- **Adobe After Effects:** Creating the 30 sec demo video\n",null,"https://www.youtube.com/watch?v=ZuHLtdbaXqc",null,null,"starclock.png",15770556e5,C.yK,C.k0)
