C.B1=new O.cv("Pokeroute","pokeroute","This was a small project to evaluate how stable and usable Flutter Web was at the time. The app allows you to optimize your route through a list of GPS coordinates. It's intended for Pok\xe9mon GO spoofers to minimize their server timeout (soft ban) when teleporting.","rest api, gps calculations","- **REST api:** The pokeapi was used to load Pok\xe9mon data\n- **GPS:** Distance calculation\n- **Recursion:** Calculate the optimal route",null,null,null,"https://pokeroute.web.app/","pokeroute.png",15667704e5,C.yH,C.qD)
