C.AR=new O.cv("Am I Done Yet","am-i-done-yet","This was my submission for the [Flutter Create challenge.](https://flutter.dev/create)\n> Flutter Create is a contest that challenges you to build something interesting, inspiring, and beautiful with Flutter using 5KB or less of Dart code.\n\nThe app itself is a simple todo app, but with a twist.\n\n#### Features:\n- Add a new item *(pinned)*\n- Swipe to set priority *(unpins it)*\n- Long press to delete\n\nIt doesn't get much simpler than that, but it works surprisingly well, especially for lists of loosely prioritized todos with no exact due time.\n\nI couldn't fit a local database within the 5120 character limit, so the app required an account to store the data in the cloud via Firestore (which is kind of ridiculous if you think about it).\n\nI've since rewritten the app to use a local database instead.","firebase, sembast (local database), animations","#### Originally:\n- **Flutter:** This was my first project with Flutter\n- **Firebase:** Auth, Firestore\n#### During the rewrite:\n- **Sembast:** Local database\n- **Flutter:** Animations & SliverLists\n- Restructuring and modularizing code properly\n",null,null,"https://play.google.com/store/apps/details?id=com.ciriousjoker.amidoneyet",null,"amidoneyet.png",15526044e5,C.yp,C.k0)
