C.AO=new O.cv("ShufflePaper","shufflepaper","This is a wallpaper manager for your Chromebook.\nChrome OS does come with a way to change the current wallpaper, but it's pretty limited in it's functionality, even years later.\n#### Features:\n- Pick a folder and shuffle through it (manually or automatically)\n- Set an interval to update the wallpaper automatically\n- Pick the next wallpaper alphanumerically or at random\n\nChrome apps will be discontinued in the future, but this app bridged a functionality gap during a time where Android apps weren't available yet.","javascript, html, css, material design","This was my first real project with web technologies using html, css and vanilla js. Originally I didn't even use Promises, since the async/await syntax wasn't widespread yet. \n\nIn 2019, I decided to rewrite large parts of the app clean up the code, fix bugs, add functionality, and completely change the UI. \n\nThe new UI was written using Material Design Lite and parts of its successor, Material Design Components for Web.",null,null,null,"https://shufflepaper.web.app/","shufflepaper.png",14886684e5,C.yD,C.qG)
