C.B2=new O.cv("Homing Compass","HomingCompass","A homescreen widget that always points towards home (or any other location you specify). You can switch between multiple locations and the widget displays the direction and distance.\n\nWas a parting gift for a friend who travelled abroad :)","Android, widgets, GPS, threads","- **GPS & Maps Api:** Location picker & geolocation detection\n- **Widgets:** The widget is essentially an svg icon that's being transformed\n- **Threads:** The widget is updated through a background thread\n- Distance calculations on a sphere aren't straightforward ;)\n",null,null,"https://play.google.com/store/apps/details?id=com.ciriousjoker.homingcompass",null,"homingcompass.png",1474636718e3,C.ys,C.k0)
C.AU=new O.cv("SideNote","SideNote","This program was my first attempt at C#/.NET + WPF, after being fascinated by the UI of a tool called Curse Voice, which was written in it (at least according to their open hiring positions at the time).\n#### Features:\n- **Autosaving:** Note is automatically saved\n- **shift+tab:** Slide in/out from the right screen edge\n- **Settings:** Font family, font size & color theme","c#, .net, wpf, animations & state management","- **C#:** Language of choice when developing for Windows\n- **WPF:** Windows Presentation Foundation was used for the GUI\n- **Animations:** Basic animations, concept of easing & animation curves\n- **State management:** Basic state management to reflect settings changes like color themes immediately without restarting","https://github.com/CiriousJoker/SideNote/releases/latest",null,null,null,"sidenote.png",14463324e5,C.qC,C.qW)
