C.AW=new O.cv("nTradeAdvanced","nTradeAdvanced","A program for the Ti-Nspire CAS calculator, which allows you to trade Pok\xe9mon between two third gen Pok\xe9mon games. \n\nOnce you've rooted your device using Ndless, you can install a GBA emulator and play Pok\xe9mon. There is no link functionality available, but with this tool, you can trade Pok\xe9mon anyway. \n\nJust transfer the .sav files, run this tool, and trade Pok\xe9mon between them. I also included a little tool to fix corrupted save states, which could be caused by cheating.\n\n**Supported games:** Firered/Leafgreen, Ruby/Sapphire, Emerald","c, pointer arithmetic, checksums","- Developed in c, c++ wasn't available in the Ndless sdk yet\n- Basics of embedded programming with tight hardware constraints\n- Understanding inofficial reverse-engineered documentation about save formats\n- Pointer arithmetic to modify the savestates in-memory\n- Recalculating checksums to repair a corrupted save file\n","https://github.com/CiriousJoker/nTradeAdvanced/releases/latest",null,null,null,"ntradeadvanced.png",14062464e5,C.yx,C.yZ)
